import React, { useState } from 'react';

import './Navbar.css';
import { Link } from 'react-router-dom';
import {GiHamburgerMenu} from 'react-icons/gi'

const Navbar = () => {

  const [toggleMenu, setToggleMenu] = useState(false)

  return (
    <div className='cv__navbar'>
      <div className='cv__navbar-heading'>
        <div className='cv__navbar-heading_square'></div>
        <div className='cv__navbar-heading_name'>
          <Link to='/'>
            <h2>Alok Awasthi</h2>
            <p> / SOFTWARE DEVELOPER</p>
          </Link>
        </div>
      </div>

      <ul c>
        <li>ABOUT ME</li>
        <li>RESUME</li>
        <li>EXPERIENCE</li>
        <li>CONTACT</li>
      </ul>

      <div className='cv__navbar-smallscreen'>
        <GiHamburgerMenu onClick={() => setToggleMenu(false)}/>

        {toggleMenu && (
          <div className='cv__navbar-smallscreen-links'></div>
        )}
      </div>
    </div>
  );
}
export default Navbar;
